# 混合端口
mixed-port: 7890
# 局域网访问控制(白名单/黑名单)
allow-lan: true
lan-allowed-ips: ['0.0.0.0/0', '::/0']
lan-disallowed-ips: []
# 运行模式
mode: rule
# 日志级别
log-level: info
# 接受IPv6流量
ipv6: true
# 外部控制监听地址、访问密钥
external-controller: 0.0.0.0:9090
secret: ''
# 延迟计算去除握手等额外延迟
unified-delay: true
# TCP并发
tcp-concurrent: true
# 全局客户端指纹(支持VLESS,VMess,Trojan)
global-client-fingerprint: chrome
# 下载外部资源(proxy-provider、rule-provider、GEO等)使用的UA
global-ua: clash.meta

# DNS配置
nameservers: &nameservers
  - https://dns.alidns.com/dns-query # 阿里云公共DNS
  - https://doh.pub/dns-query # 腾讯DNSPod
  - https://doh.360.cn/dns-query # 360安全DNS
fallback_nameservers: &fallback_nameservers
  - https://1.1.1.1/dns-query # Cloudflare
  - https://208.67.222.222/dns-query # OpenDNS(主)
  - https://208.67.220.220/dns-query # OpenDNS(备)
  - https://194.242.2.2/dns-query # Mullvad(主)
  - https://194.242.2.3/dns-query # Mullvad(备)
dns:
  enable: true
  ipv6: true
  use-hosts: true
  cache-algorithm: arc
  enhanced-mode: fake-ip
  fake-ip-range: 198.18.0.1/16
  fake-ip-filter: ['+.msftconnecttest.com', '+.msftncsi.com']
  default-nameserver: [1.1.1.1, 223.5.5.5]
  nameserver-policy:
    'geosite:private,geolocation-cn': *nameservers
    'geosite:google,youtube,telegram,gfw,geolocation-!cn': *fallback_nameservers
  nameserver: *nameservers
  fallback: *fallback_nameservers
  fallback-filter:
    geoip: true
    geoip-code: CN
    ipcidr: [240.0.0.0/4]

# GEO自动更新、更新间隔(单位: 小时)、更新下载地址
geo-auto-update: true
geo-update-interval: 48
geox-url:
  geoip: https://fastly.jsdelivr.net/gh/MetaCubeX/meta-rules-dat@release/geoip.dat
  geosite: https://fastly.jsdelivr.net/gh/MetaCubeX/meta-rules-dat@release/geosite.dat
  mmdb: https://fastly.jsdelivr.net/gh/MetaCubeX/meta-rules-dat@release/country.mmdb

